			_onChange: function _onChange() {
						this.setState(getStateFromStores());
			},

			_onDoubleClick: function _onDoubleClick(fieldName) {
						var isEditing = this.state.isEditing;
						isEditing.add(fieldName);
						this.setState({ isEditing: isEditing });
			},

